import React from "react";
import styles from "./Line.module.scss";
const Line = ({isTouched, onToggle}) => {
  return (
      <div onClick={onToggle} className={`${styles.line} ${isTouched && styles['add-block']}`}>
        <div className={styles.button}>
          <div></div>
          <div></div>
        </div>
        <div className={styles.right}>
          <div>Triết lý mà G-Store theo đuổi là gì</div>
        </div>
      </div>
  );
};

export default Line;
